    "Description": "",
    "Excerpt": "<strong>Manufacturer's Description: </strong>The Wave is a stable-understable high speed distance driver best described as a longer <a href=\"http://stage.hyzershop.com/product/mvp-inertia/\" target=\"_blank\">Inertia</a>, with a stable-understable flight profile and a responsiveness that makes it useful across the power spectrum. The defining characteristic of the Wave is its balance of turn and fade. Its shallow turn is capable of extending lines while its fade is subtle but reliable enough to range and place shots.\n\nHigh powered throwers will see turn and hyzer flip tendencies from the Wave, while average power throwers may need a headwind assistance or anhyzer release to activate the turning capabilities of the Wave. Beginners will find a usable, yet quite overstable flight in the Wave, due to the high power requirements of wide-rimmed distance drivers. The Wave is versatile and can perform a number of stable-understable roles.",
