    "Excerpt": "<strong>Manufacturer's Description:</strong>\n<div class=\"shortdescription\">The Wrath is a stable-overstable distance driver. The Wrath is a more turn-resistant complement to the <a href=\"http://stage.hyzershop.com/product/axiom-insanity/\">Insanity</a>. Just as the Insanity mimics a broken-in <a href=\"http://stage.hyzershop.com/product/mvp-inertia/\">Inertia</a>, the Wrath brings a worn-in flavor to the beloved <a href=\"http://stage.hyzershop.com/product/mvp-tesla/\">Tesla</a> flight profile. Power throwers will find the Wrath able to turn on command to stretch out and shape distance lines, while average throwers will see a bit of resistance useful for headwinds and fading lines. The low-speed fade of the Wrath is enough to range your shot and rein in a turnover line.</div>",
