    "Description": "",
    "Excerpt": "<strong>Manufacturer's Description:</strong>\n\nThe defining characteristic of the Insanity's flight is its slow turn and straight fade, crafted by design with softened shapes to mimic a worn <a href=\"http://stage.hyzershop.com/product/mvp-inertia/\">Inertia</a>. Thusly the Insanity needs less power to execute certain Inertia flights, and will exhibit a bit more turn and a noticeably more neutral fade portion than the Inertia.\n\nHigh power throwers will see enhanced glide and forward carry at low speeds, making it useful for a variety of low-ceiling shots and higher tailwind-riding lines. Average power throwers will see the most advantage with low height drives that gain distance and have enough stability to easily range.\n\nThe Insanity is most suited to backhand drives, and either highly skilled forehands, or beginner-power forehands. Its high speed turn excels for hyzer-flip drives, turnovers, and smooth-power flat laserbeams, as well as a variety of utility and tailwind shots.",
